ScaDaMaLe Course site and book The Medallion Lakehouse Architecture aims to structure data quality amongst different levels. From Bronze, to Silver, and to Gold levels, data that is originally unstructured and uncleaned, is more structured and cleaned for higher-level tables. Even many examples of this type of architecture is shown with Delta Live Tables, this can just as well be implemented in any open source Lakehouse architecture, with Delta Tables in your own open source solution. Reading: - https://docs.databricks.com/lakehouse/medallion.html#bronze - https://medium.com/@omarlaraqui/the-medallion-architecture-21fe878d1aca Repository with some examples: - https://github.com/databricks/delta-live-tables-notebooks medallion architecture Bronze layer The Bronze Layer contains the raw data that is ingested from batch or streaming. The data in this layer can be of various formats, from different sources and preferably stored in a file store that can hold high volumes of unstructured data. Silver layer In the Silver Layer of the lakehouse, data is validated, prepared and cleaned for general business use. Null values are replaced, joins with lookup tables, filters etc to give data that can be trusted for analytics, machine learning and business logic. Gold layer Gold Layer is refined and structured data that is ready for consumption in specific projects. It can be ready for use in Business Intelligence and Machine Learning. Here is a minimal code example showing the medallion architecture in Delta Live Tables, taken from the Databricks Delta Live Tables notebooks repository . Observe the transormations made to each of the queries defining each table. For the bronze clickstream_raw table, data is simlpy ingested in JSON format. In the (silver) clickstream_clean table, bronze data is cleansed and selected to produce data that it has "just enough" properties for analytics and ML. Lastly, the two gold tables (top_spark_referrersand top_pages) are filtered, aggregated, sorted for "project specific" Business Intelligence use. from pyspark.sql.functions import *
from pyspark.sql.types import *
import dlt json_path = "/databricks-datasets/wikipedia-datasets/data-001/clickstream/raw-uncompressed-json/2015_2_clickstream.json" # Bronze
@dlt.create_table( comment="The raw wikipedia click stream dataset, ingested from /databricks-datasets.", table_properties={ "quality": "bronze" }
)
def clickstream_raw(): return ( spark.read.option("inferSchema", "true").json(json_path) ) # Silver
@dlt.create_table( comment="Wikipedia clickstream dataset with cleaned-up datatypes / column names and quality expectations.", table_properties={ "quality": "silver" }
)
@dlt.expect("valid_current_page", "current_page_id IS NOT NULL AND current_page_title IS NOT NULL")
@dlt.expect_or_fail("valid_count", "click_count > 0")
def clickstream_clean(): return ( dlt.read("clickstream_raw") .withColumn("current_page_id", expr("CAST(curr_id AS INT)")) .withColumn("click_count", expr("CAST(n AS INT)")) .withColumn("previous_page_id", expr("CAST(prev_id AS INT)")) .withColumnRenamed("curr_title", "current_page_title") .withColumnRenamed("prev_title", "previous_page_title") .select("current_page_id", "current_page_title", "click_count", "previous_page_id", "previous_page_title") ) # Gold
@dlt.create_table( comment="A table of the most common pages that link to the Apache Spark page.", table_properties={ "quality": "gold" } )
def top_spark_referrers(): return ( dlt.read("clickstream_clean") .filter(expr("current_page_title == 'Apache_Spark'")) .withColumnRenamed("previous_page_title", "referrer") .sort(desc("click_count")) .select("referrer", "click_count") .limit(10) ) # Gold
@dlt.create_table( comment="A list of the top 50 pages by number of clicks.", table_properties={ "quality": "gold" } )
def top_pages(): return ( dlt.read("clickstream_clean") .groupBy("current_page_title") .agg(sum("click_count").alias("total_clicks")) .sort(desc("total_clicks")) .limit(50) )
